import * as Constants from "../constants.js";
import axios from 'axios';

/* across several years : line chart */
async function FilterByDateApi(date) {

    const userid = localStorage.getItem('uid');
    var url = Constants.base_url + "/filterByDate/?userId=" + userid + "&date=" + date;

    var config = {
      method: 'get',
      url: url,
      headers: {}
    };

    let returnValue;

    await axios(config).then(function(response) {
      // console.log(response.data, typeof(response.data["bugs"]));
      // console.log(response.data.bugs[0]);
      returnValue = response.data;

    }).catch(function(error) {
      console.log(error);
    });

    return returnValue;

}

export default FilterByDateApi;
